import {useEffect, useState} from 'react'
import Nav from './views/Nav'  
import axios from "axios";
import './App.css';

function App() {

  const [data, setData] = useState([])
  const options = {
    method: 'POST',
    url: 'https://microsoft-computer-vision3.p.rapidapi.com/analyze',
    params: {
      language: 'en',
      descriptionExclude: 'Celebrities',
      visualFeatures: 'ImageType',
      details: 'Celebrities'
    },
    headers: {
      'content-type': 'application/json',
      'x-rapidapi-key': 'cc687eba84mshcc7485fcf110baap193a15jsnfb1be463a74d',
      'x-rapidapi-host': 'microsoft-computer-vision3.p.rapidapi.com'
    },
    data: {url: 'http://example.com/images/test.jpg'}
  };
  useEffect(() => {
    axios
      .request(options)
      .then(function (res) {
        setData(res.data)
        console.log(res.data);
      }).catch(function (err) {
        console.error(err);
      });
  }, [url])


  return (
    <div className="App">
      <Nav data={data}/>
      This is the App
    </div>
  );
}

export default App;
